import React from "react";
import TableHeader from "../TableHeader";
import TableRows from "../TableRows"
import "./style.css"

function createTable({keys, data}) {
    return (
        <div className="employee-table">
            <table>
                <TableHeader keys={keys}/>
                <TableRows data={data}/>
            </table>
        </div>
    )
};

export default createTable
